import React from "react";
import { BrowserRouter } from "react-router-dom";

const RouterDom = () => {
  return (
    <BrowserRouter>
      <div>
        <span>RouterDom</span>
      </div>
    </BrowserRouter>
  );
};

export default RouterDom;

